script: |
  super -f text -I q960.spq | sort > q960.out

inputs:
  - name: q960.spq
    data: |
      SELECT DISTINCT - tab1.col0 * - 43 * - col1 + tab1.col2 + + ( col1 ) * col2 / - col2 AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q960.out
    data: |
      -27473
      -3326
      -44637
